import './style.css'

function Navbar() {
    return (
            <nav>
                <li>
                    <a href="https://github.com/MAA28">GitHub</a>
                </li>
                <li>
                    <a href="/blogs">Blogs</a>
                </li>
                <li>
                    <a href="https://www.instagram.com/malteaschenbach/">Instagram</a>
                </li>
            </nav>
    );
}

export default Navbar;
